import styled from "styled-components";
import { Column, ImageContainer, Row, RowSpaceBetween, TextWrapper } from "../styled";
//@ts-ignore
import Inspiration from "../assets/svg/sidenav/inspiration.svg";
//@ts-ignore
import Templates from "../assets/svg/sidenav/templates.svg";
//@ts-ignore
import Collections from "../assets/svg/sidenav/collection.svg";
//@ts-ignore
import Brands from "../assets/svg/sidenav/brands.svg";


const SideBar = () => {
  const sideNavNames: Array<{ navName: string; navImageUrl: string }> = [
    {
      navName: "Inspiration",
      navImageUrl: Inspiration,
    },
    {
      navName: "Templates",
      navImageUrl: Templates,
    },
    {
      navName: "Collections",
      navImageUrl: Collections,
    },
    { navName: "Brands", navImageUrl: Brands},
  ];
  return (
    <SideBarWrapper>
      {sideNavNames.map(
        (nav: { navName: string; navImageUrl: string }, index: number) =>
          index == 0 ? <RowSpaceBetween>
            <SideNav>
                <ImageContainer src={nav.navImageUrl} width="18px" height="18px"/>
                <TextWrapper fontWeight="600">Inspiration</TextWrapper>
            </SideNav>
          </RowSpaceBetween> : <SideNav></SideNav>
      )}
    </SideBarWrapper>
  );
};

export default SideBar;

const SideBarWrapper = styled(Column)`
  background: rgba(245, 245, 245, 0.5);
  max-width: 250px;
  border-right: 1px solid rgba(180, 180, 180, 1);
  width: 100%;
  height: calc(100vh - 80px);
  padding: 10px;
`;

const SideNav = styled(Row)`
padding: 15px;
border-radius: 6px;
border: 1px solid #A259FF;
width: fit-content;

`;
